export default App;

function App() {
  return (
    <div>
      <Header />
    </div>
  );
}

function Header() {
  return (
    <div>
      {" "}
      <h1>Let's Go To Travel</h1>
    </div>
  );
}

function Form() {
  return (
    <div>
      <span>What does you need for your trip?</span>
    </div>
  );
}

function PackagingList() {
  return <div className="list"></div>;
}

function Footer() {
  return (
    <footer>
      You have packed x items on your list , and you already packed x (x %)
    </footer>
  );
}
